  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144622 includes Surface
  underway data collected from WEATHERBIRD II in the Coastal Waters of Florida and
  Gulf of Mexico from 2008-08-11 to 2011-06-30. These data include DISSOLVED INORGANIC
  CARBON (DIC), Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial
  pressure (or fugacity) of carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE,
  TOTAL ALKALINITY (TA), WATER TEMPERATURE and pH. The instruments used to collect
  these data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Lisa
  Robbins and Kira Barrera of US DOI; US Geological Survey as part of the USGS_Florida_Shelf
  data set. CDIAC associated the following cruise ID(s) with this data set: USGS20080811\",\n\t\"license_title\":
